import React from 'react'
import { Link } from 'react-router-dom'

export default class MenuButton extends React.Component {
    render(){
        return(
            <div className="menu">
                <button class="menu-button">Menu</button>
                <div className="menu-content">
                    <Link to="/">
                        <li>Home</li>
                        {/* <a href="#">Home</a> */}
                    </Link>
                    <Link>
                        <li>My Profile</li>
                        {/* <a href="#">My Profile</a> */}
                    </Link>
                    <Link>
                        <li>Add Video</li>
                        {/* <a href="#">Add Video</a> */}
                    </Link>
                    <Link>
                        <li>Add Playlist</li>
                        {/* <a href="#">Add Playlist</a> */}
                    </Link>

                </div>
            </div>
        )
    }
}
